import { useState } from "react";
import "./App.css";

function App() {
  const [count, setcount] = useState(0);
  return (
    <>
      <h1>
        total click {count}
        <button onClick={() => setcount(count + 1)}> click me </button>
      </h1>
    </>
  );
}

export default App;
